</div>
`.trim();

const textCenter = `
.circle {
  width: 100px;
  height: 100px;
  background-color: #999;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
}

<div class="circle">Text Here</div>
`.trim();

const rowColom = `
.circle {
